import React from 'react'

 const FaceBookButton=()=> {
  return (
    <div>

        <FacebookLoginButton
          onClick={() => window.FB.login()}
          activeStyle={{ background: 'rgb(59,91,150)' }}
          style={{ background: 'rgb(42,144,237)' }}>
          <span>Continue with facebook</span>
        </FacebookLoginButton>

    </div>
  )
}

export default FaceBookButton;
